#Step 5: Encode Cyclic Features

def encode_cyclic_features(data, col, max_val):
    data[col + '_sin'] = np.sin(2 * np.pi * data[col] / max_val)
    data[col + '_cos'] = np.cos(2 * np.pi * data[col] / max_val)

encode_cyclic_features(data, 'month', 12)
encode_cyclic_features(data, 'day', 31)
encode_cyclic_features(data, 'hour', 24)
encode_cyclic_features(data, 'minute', 60)

